import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    bootstrap: {
        color: 'purple',
        borderWidth: 2,
        borderColor: 'purple'
    }
};

export default class ChipsBoostrap extends Component {
    render() {
        return (
            <Chip label="Bootstrap" variant="outlined" style={Style.bootstrap}/>
        );
    }
}
